import React from 'react';
import './AnswerItem.css';

const answerItem = props =>{
    return(
        <div className='AnswerItem'>
            <p>{props.text}</p>
            <p>{props.user}</p>
            <p>{props.creationDate}</p>
        </div>
    );
};

export default answerItem;
